// SPDX-License-Identifier: MIT
pragma solidity 0.6.6;

import "./Context.sol";
import "./Ownable.sol";
import "./IERC20.sol";
import "./SafeERC20.sol";
import "./SafeMath.sol";
import "./ReentrancyGuard.sol";
import "./AggregatorV3Interface.sol";

contract DRCSeller is Context, ReentrancyGuard, Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    IERC20 private _token;
    address payable private _wallet;
    uint256 private _rate;
    uint256 private _tokensSold;
    bool private _end;
    AggregatorV3Interface BUSDBNB =
        AggregatorV3Interface(0x87Ea38c9F24264Ec1Fff41B04ec94a97Caf99941);
    IERC20 BUSD = IERC20(0xe9e7CEA3DedcA5984780Bafc599bD69ADd087D56);
    // AggregatorV3Interface BUSDBNB =
    //     AggregatorV3Interface(0x0630521aC362bc7A19a4eE44b57cE72Ea34AD01c);//testnet
    // IERC20 BUSD = IERC20(0xE0dFffc2E01A7f051069649aD4eb3F518430B6a4);//testnet


    event TokensPurchased(address indexed beneficiary, uint256 tokenAmount);
    event RateChanged(uint256 rate);

    constructor(
        uint256 rate_,
        address payable wallet_,
        IERC20 token_
    ) public {
        require(rate_ > 0, "Rate is 0");
        require(wallet_ != address(0), "Wallet is the zero address");
        require(address(token_) != address(0), "Token is the zero address");
        _rate = rate_;
        _wallet = wallet_;
        _token = token_;
        _end = false;
    }

    receive() external payable {
        buyDRCwithBNB();
    }

    fallback() external payable {
        buyDRCwithBNB();
    }

    function token() public view returns (IERC20) {
        return _token;
    }

    function wallet() public view returns (address payable) {
        return _wallet;
    }

    function rate() public view returns (uint256) {
        return _rate;
    }

    function setRate(uint256 r) public onlyOwner {
        _rate = r;
        emit RateChanged(_rate);
    }

    function saleEnded() public view returns (bool) {
        return _end;
    }

    function setEnd(bool end) external onlyOwner {
        _end = end;
    }

    function tokensSold() public view returns (uint256) {
        return _tokensSold;
    }

    function remainingTokens() public view returns (uint256) {
        return _token.allowance(_wallet, address(this));
    }

    function buyDRCwithBNB() public payable nonReentrant {
        address beneficiary = _msgSender();
        uint256 amount = msg.value;
        require(amount != 0, "Amount is 0");
        uint256 BNBPrice = uint256(BUSDBNB.latestAnswer());
        uint256 tokenAmount = _getTokenAmount(amount.mul(10**18).div(BNBPrice));
        _preValidatePurchase(beneficiary, tokenAmount);
        _processPurchase(beneficiary, tokenAmount);
        emit TokensPurchased(beneficiary, tokenAmount);
        forwardBNB();
    }

    function buyDRCwithBUSD(uint256 amount) public nonReentrant {
        address beneficiary = _msgSender();
        require(amount != 0, "Amount is 0");
        require(BUSD.balanceOf(beneficiary) >= amount, "Not Enough Balance");
        require(
            BUSD.allowance(beneficiary, address(this)) >= amount,
            "Not Enough Allowance"
        );
        uint256 tokenAmount = _getTokenAmount(amount);
        _preValidatePurchase(beneficiary, tokenAmount);
        BUSD.safeTransferFrom(beneficiary, address(this), amount);
        _processPurchase(beneficiary, tokenAmount);
        emit TokensPurchased(beneficiary, tokenAmount);
        forwardBUSD();
    }

    function _preValidatePurchase(address beneficiary, uint256 tokens)
        internal
        view
    {
        require(!_end, "Sale Ended");
        require(beneficiary != address(0), "Buyer is the zero address");
        require(tokens != 0, "Sale token amount is 0");
        require(remainingTokens() >= tokens, "Less tokens remaining");
    }

    function _deliverTokens(address beneficiary, uint256 tokenAmount) internal {
        _token.safeTransferFrom(_wallet, beneficiary, tokenAmount);
        _tokensSold = _tokensSold.add(tokenAmount);
    }

    function _processPurchase(address beneficiary, uint256 tokenAmount)
        internal
    {
        _deliverTokens(beneficiary, tokenAmount);
    }

    function _getTokenAmount(uint256 amount) internal view returns (uint256) {
        return amount.mul(_rate).mul(10**9).div(10**18);
    }

    function forwardBNB() public {
        _wallet.transfer(address(this).balance);
    }

    function forwardDRC() public {
        if (_token.balanceOf(address(this)) > 0) {
            _token.safeTransfer(_wallet, _token.balanceOf(address(this)));
        }
    }

    function forwardBUSD() public {
        BUSD.safeTransfer(_wallet, BUSD.balanceOf(address(this)));
    }
}
